import React from 'react'

type Props = {}

export const Footer = (props: Props) => {
    return (
        <div className="footer">
            <ul>
                <li><img src={require()} alt="home-logo" /></li>
                <li><img src="" alt="user-logo" /></li>
                <li><img src="" alt="loupe-logo" /></li>
                <li><img src="" alt="fav-logo" /></li>
                <li><img src="" alt="add-logo" /></li>
            </ul>
        </div>
    )
}
